import Footerr from "../Footer";
import NavBar from "../Navbar";
import { useState, useEffect } from "react";
import Axios  from 'axios';

const Appmnt = () => {
    const [testList, setTestList] = useState([]);

    useEffect(() => {
      Axios.get("http://localhost:5000/appmntt")
      .then((response) => {
          setTestList(response.data)
      })
      
    
    }, [])
    
    return ( 
        <div>
            <NavBar></NavBar>
        
            <div className="text-center fs-3 p-3">Test Appointment</div>
            <div className="container  bg-light mt-3 p-3 ml-3"> {testList.map((test) => {
                return (
                    <div className="container p-2"> {test.testName} <button type="submit" className="btn btn-primary btn-sm mr-0">buy</button> </div>

                    
                )
            } )} </div>






            <Footerr></Footerr>
        </div>
     );
}
 
export default Appmnt;
